import{_ as e,o as i,c as t,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 2.2-427 Filings; inspection.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-427.md","filePath":"vacode/2.2-427.md"}'),a={name:"vacode/2.2-427.md"},n=r('<h1 id="§-2-2-427-filings-inspection" tabindex="-1">§ 2.2-427 Filings; inspection. <a class="header-anchor" href="#§-2-2-427-filings-inspection" aria-label="Permalink to &quot;§ 2.2-427 Filings; inspection.&quot;">​</a></h1><p>Registration statements shall be open to public inspection and copying during the regular business hours of the office of the Secretary of the Commonwealth. Lobbying reports shall be open to public inspection and copying during the regular business hours of the Council.</p><p>Registration statements shall be deemed to have been filed only when actually received in the office of the Secretary or mailed to the Secretary by registered, certified, or regular mail with the sender retaining sufficient proof of mailing, which may be a United States Postal Certificate of Mailing. Lobbying reports shall be deemed to have been filed only when received by the Council in accordance with the standards approved by the Council pursuant to § <a href="http://law.lis.virginia.gov/vacode/30-356/" target="_blank" rel="noreferrer">30-356</a>.</p><p>1994, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0857" target="_blank" rel="noreferrer">857</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0937" target="_blank" rel="noreferrer">937</a>, § 2.1-787; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>; 2016, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0773" target="_blank" rel="noreferrer">773</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0774" target="_blank" rel="noreferrer">774</a>.</p>',4),o=[n];function l(s,c,h,g,p,f){return i(),t("div",null,o)}const b=e(a,[["render",l]]);export{_ as __pageData,b as default};
